import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SuperAdminApp from './adminApps/SuperAdminApp';
import ResellerAdminApp from './adminApps/ResellerAdminApp';
import ClientAdminApp from './adminApps/ClientAdminApp';

const App = () => {
  // const userType = sessionStorage.getItem('userType');

  // // Example fallback for unknown user types
  // if (!['superAdmin', 'resellerAdmin', 'clientAdmin'].includes(userType)) {
  //   return <Navigate to="/" />;
  // }

  return (
    <Router>
      <Routes>
      <Route path="/" element={<SuperAdminApp />} />
          <Route path="/ResellerdminApp" element={<ResellerAdminApp />} />
          <Route path="/clientadmin" element={<ClientAdminApp />} />
        {/* {userType === 'superAdmin' && <Route path="/" element={<SuperAdminApp />} />}
        {userType === 'resellerAdmin' && <Route path="/" element={<ResellerAdminApp />} />}
        {userType === 'clientAdmin' && <Route path="/" element={<ClientAdminApp />} />} */}
      </Routes>
    </Router>
  );
};

export default App;
